            @Override
            public void run() {
                HalfSerializer.onError(ts, ex, wip, error);
            }
        };

        Runnable r2 = new Runnable() {
            @Override
            public void run() {
                HalfSerializer.onComplete(ts, wip, error);
            }
        };

        TestHelper.race(r1, r2);

